window.onload = function() {
  var mainDiv = document.getElementById('episodes');
  var imageCounter = 0;
  for (var i = 0; i < urlList.length; i++) {
    var seasonDiv = document.createElement('div');
    seasonDiv.className = "main event";
    for (var j = 0; j < urlList[i].length; j++) {
      if (j === 0) {
        var item = document.createElement('h3');
        item.innerHTML = '<a target="_blank" href=' + baseURL + urlList[i][j] + '>' + titleList[i][j] + '</a>';
        seasonDiv.appendChild(item);
      } else {
        var item = document.createElement('p');
        item.innerHTML = '<a target="_blank" href=' + baseURL + urlList[i][j] + '>' + titleList[i][j] + '<img src=' + imageList[imageCounter] + ' class="epImage"></a>';
        seasonDiv.appendChild(item);
        imageCounter++;
      }
    }
    mainDiv.appendChild(seasonDiv);
  };
};

